INSERT INTO `wa2_dadminnotification_inbox` VALUES (1,4,'2016-12-14 18:39:37','New Magento 2 Releases Feature Payment, Performance & Quality Enhancements – 12/14/2016','Community Editions 2.1.3 and 2.0.11 feature new payment functionality, accelerated performance, and enhanced product quality. Learn more in the release notes at http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html ','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),(2,4,'2016-12-16 06:16:21','Are you a Magento Developer? Take our developer experience survey by December 21.','As a Magento developer, your feedback is critical to the success of the Magento platform. We invite you to complete a survey about your experience developing on the Magento 2 platform. The results will help us improve our product and resources to enable your continued success. The survey should take no more than 10 minutes and all information you provide will remain strictly confidential. https://www.research.net/r/SL7VVNR','https://www.research.net/r/SL7VVNR',0,0),(3,4,'2017-01-03 04:04:50','Happy 2017! We want your opinion. Take our Retail Trends survey.','Let us know what is important to you and your business for 2017. We invite you to take our retail trends survey which should take no more than a few minutes to complete. As always, any individual information you provide will remain strictly confidential.\n\nTo participate, go to: https://www.research.net/r/PWJCD2X ','https://www.research.net/r/PWJCD2X',0,0),(4,1,'2017-01-14 02:33:07','New Zend Framework Security Vulnerability – 1/13/2017','We’ve found a new vulnerability in a Zend Framework 1 and 2 email component used by all Magento 1 and Magento 2 software (as well as other PHP solutions). This vulnerability is serious and can lead to a remote code execution attack if your servers use Sendmail as a mail transport agent. Learn how to protect your sites at https://magento.com/security/news/new-zend-framework-1-security-vulnerability\n\n','https://magento.com/security/news/new-zend-framework-1-security-vulnerability',0,0),(5,4,'2017-01-19 16:59:15','New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017','Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.','https://magento.com/blog/technical/set-your-magento-2-development-environment-faster',0,0),(6,1,'2017-02-07 20:02:30','Community Editions 2.1.4 and 2.0.12 Resolve Zend Framework Security Issue & Enhance Product Quality – 2/7/2017','Community Editions 2.1.4 and 2.0.12 address the recent Zend Framework 1 security vulnerability and improve catalog, payments, and sales modules. Review the release notes for more information:  http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0);
