INSERT INTO `wa2_dcatalog_product_entity_text` VALUES (2249,85,0,2186,'2012 verano,pantalones'),(2250,85,0,2187,'2011 invierno,poleras'),(2251,76,0,2188,'<p>Composicion: 100% denim <br /><br /> Jeans clásico recto color indigo oscuro  Push in Push Up (contención en abdomen y efecto push up en trasero)</p>\n<p> </p>\n<p><span style=\"font-size:11px;\">* Modelo de la fotografía mide 1.75 cms de alto y luce jeans en talla 38</span></p>'),(2252,85,0,2188,'2016 verano,jeans'),(2253,76,0,2189,'<p>DETALLES:</p>\n<ul><li>Vestuario línea Infantil</li>\n<li>Material: 100% poliester</li>\n<li>Talla S: 8 años</li>\n<li>Talla M. 10 años</li>\n<li>Talla L: 12 años</li>\n<li>Talla XL: 14 años</li>\n</ul>'),(2254,85,0,2189,'2015 verano,parka,infantil,niña,niñita'),(2255,76,0,2190,'<p>DETALLES:</p>\n<ul><li>Vestuario línea Infantil</li>\n<li>Material: 100% poliester</li>\n<li>Talla S: 8 años</li>\n<li>Talla M. 10 años</li>\n<li>Talla L: 12 años</li>\n<li>Talla XL: 14 años</li>\n</ul>'),(2256,85,0,2190,'2015 verano,parka,infantil,niña,niñita'),(2257,76,0,2191,'<p>DETALLES:</p>\n<ul><li>Vestuario infantil</li>\n<li>Composición: 100% poliester</li>\n<li>Abrigo de niñita compuesto por doble corrida de botones en delantero y 1 bolsillo a cada costado.</li>\n<li>Detalle de botones en muñecas, cuello y espalda.</li>\n</ul>'),(2258,85,0,2191,'2015 verano,parka,infantil,niña,niñita'),(2259,76,0,2192,'<p>Material: 100% poliester<br /><br />Chaqueta corta delgada estilo trench con 4 botones en el delantero y 2 bolsillos a los costados. Forro estampado</p>\n<p><strong>Talla S:  8 años</strong></p>\n<p><strong>Talla M. 10  años</strong></p>\n<p><strong>Talla L:  12 años</strong></p>\n<p><strong>Talla XL: 14 años</strong></p>'),(2260,85,0,2192,'2012 invierno,chaquetas'),(2261,76,0,2193,'<p>Material: 100% poliester<br /><br />Chaqueta corta delgada estilo trench con 4 botones en el delantero y 2 bolsillos a los costados. Forro estampado</p>\r\n<p><strong>Talla S: &nbsp;8 a&ntilde;os</strong></p>\r\n<p><strong>Talla M. 10 &nbsp;a&ntilde;os</strong></p>\r\n<p><strong>Talla L: &nbsp;12 a&ntilde;os</strong></p>\r\n<p><strong>Talla XL: 14 a&ntilde;os</strong></p>'),(2262,85,0,2193,'2012 invierno,chaquetas'),(2263,76,0,2194,'<p>Material: 100% poliester<br /><br />Chaqueta corta delgada estilo trench con 4 botones en el delantero y 2 bolsillos a los costados. Forro estampado</p>\n<p><strong>Talla S:  8 años</strong></p>\n<p><strong>Talla M. 10  años</strong></p>\n<p><strong>Talla L:  12 años</strong></p>\n<p><strong>Talla XL: 14 años</strong></p>'),(2264,85,0,2194,'2012 invierno,chaquetas'),(2265,76,0,2195,'<p>DETALLES:</p>\n<ul><li>Vestuario línea Infantil</li>\n<li>Composición: 60% algodón, 40% poliester</li>\n<li>Chaqueta niñita con capucha y chiporro estampado diseño animal print</li>\n<li>Posee 1 bolsillo grande a cada costado</li>\n<li>detalle de botones en delantero, muñecas y espalda</li>\n</ul>'),(2266,85,0,2195,'2015 verano,parka,infantil,niña,niñita'),(2267,76,0,2196,'<p>Material: 100% poliester<br /><br />Chaqueta delgada larga estilo trench con lazo a la cintura para anudar</p>\n<p><strong>Talla S:  8 años</strong></p>\n<p><strong>Talla M. 10  años</strong></p>\n<p><strong>Talla L:  12 años</strong></p>\n<p><strong>Talla XL: 14 años</strong></p>'),(2268,85,0,2196,'2012 invierno,chaquetas'),(2269,76,0,2197,'<p><strong>DETALLES:</strong></p>\n<ul><li>Vestido detalles bordados</li>\n<li>Pequeño escote en espalda</li>\n<li>Sin mangas</li>\n<li>ALGODON 100%</li>\n</ul>'),(2270,85,0,2197,'2017 verano,vestidos'),(2271,76,0,2198,'<p><strong>DETALLES:</strong></p>\n<ul><li>Polera estampada</li>\n<li>Cuello en V</li>\n<li>Sin mangas</li>\n<li>Aplicación de telas cruzadas</li>\n<li>SPANDEX 5% VISCOSA 95%</li>\n</ul>'),(2272,85,0,2198,'2017 invierno,poleras'),(2273,76,0,2199,'<p><strong>DETALLES:</strong></p>\n<ul><li>Polera estampada</li>\n<li>Cuello en V</li>\n<li>Sin mangas</li>\n<li>Aplicación de telas cruzadas</li>\n<li>SPANDEX 5% VISCOSA 95%</li>\n</ul>'),(2274,85,0,2199,'2017 invierno,poleras'),(2275,76,0,2200,'<p><span style=\"color:#2c9ffd;\">DETALLES:</span></p>\n<ul><li>Poliester</li>\n<li>Polera diseño listado</li>\n<li>Manga corta</li>\n<li>Cuello redondo</li>\n</ul>'),(2276,85,0,2200,'2013 verano,poleras'),(2277,85,0,2201,'continuidad,jeans'),(2278,85,0,2202,'2013 invierno,blusa'),(2279,85,0,2203,'2016 invierno,jeans'),(2280,85,0,2204,'2016 verano,jeans'),(2281,85,0,2205,'2017 verano,vestidos'),(2282,85,0,2206,'2016 invierno,blusa'),(2283,75,0,2219,'<p>2017 VERANO</p>'),(2284,75,0,2228,'2017 VERANO');
