INSERT INTO `wa2_dcms_block` VALUES (1,'Footer Links Block','footer_links_block','<ul class=\"footer links\">\r\n    <li class=\"nav item\"><a href=\"{{store url=\"about-us\"}}\">Contactenos</a></li>\r\n    <li class=\"nav item\"><a href=\"{{store url=\"customer-service\"}}\">Nuestros Servicios</a></li>\r\n</ul>\r\n','2016-11-01 19:03:04','2016-11-23 14:28:27',1),(2,'Contáctenos','contact-us-info','<div class=\"contact-info cms-content\">\r\n   <p class=\"cms-content-important\">We love hearing from you, our Luma customers. Please contact us about anything at all. Your latest passion, unique health experience or request for a specific product. We’ll do everything we can to make your Luma experience unforgettable every time. Reach us however you like</p>\r\n   <div class=\"block block-contact-info\">\r\n       <div class=\"block-title\">\r\n           <strong>Contact Us Info</strong>\r\n       </div>\r\n       <div class=\"block-content\">\r\n           <div class=\"box box-phone\">\r\n               <strong class=\"box-title\">\r\n                   <span>Phone</span>\r\n               </strong>\r\n               <div class=\"box-content\">\r\n                   <span class=\"contact-info-number\">1-800-403-8838</span>\r\n                   <p>Call the Luma Helpline for concerns, product questions, or anything else. We’re here for you 24 hours a day - 365 days a year.</p>\r\n               </div>\r\n           </div>\r\n           <div class=\"box box-design-inquiries\">\r\n               <strong class=\"box-title\">\r\n                   <span>Apparel Design Inquiries</span>\r\n               </strong>\r\n               <div class=\"box-content\">\r\n                   <p>Are you an independent clothing designer? Feature your products on the Luma website! Please direct all inquiries via email to: <a href=\"mailto:cs@luma.com\">cs@luma.com</a></p>\r\n               </div>\r\n           </div>\r\n           <div class=\"box box-press-inquiries\">\r\n               <s