squina superior derecha) y confirma.</p>\r\n<p>4. Se desplegar&aacute; una pantalla con el resumen de tu pedido, haz click en los botones SIGUIENTE para confirmar todos tus datos y al finalizar elige que medio de pago usar&aacute;s.</p>\r\n<p>5. Ser&aacute;s direccionado al portal de pago seleccionado, donde debes ingresar todos los datos solicitados. Una vez concluido este procedimiento tu pedido quedar&aacute; confirmado.</p>\r\n<p>6. Te enviaremos un mail con la confirmaci&oacute;n de tu pedido a tu correo.</p>\r\n<p></p>\r\n<br /><br />\r\n<p><strong>&iquest;Cu&aacute;nto demora el despacho y cu&aacute;l es su costo?</strong></p>\r\n<h3><strong>Tipos y Tiempos de Despacho</strong></h3>\r\n<p>Tenemos disponible&nbsp;<strong>2 opciones</strong>&nbsp;de despacho para tus pedidos, los cuales debes elegir al momento de pagar. Cada uno tiene sus tiempos y costos diferentes, dependiendo del tipo de despacho que elijas.</p>\r\n<p><strong>1. Despacho a Domicilio</strong></p>\r\n<p>Enviamos tu compra a la direcci&oacute;n que escojas</p>\r\n<p>Las entregas se realizan s&oacute;lo en d&iacute;as h&aacute;biles (eso significa de lunes a viernes exceptuando feriados) y de 9:00 a 20:00 horas.</p>\r\n<p>El costo es fijo de $3.990 para todo Chile, independiente de la cantidad de productos que tengas en el carrito.</p>\r\n<p>El timing de despacho depender&aacute; de la comuna y regi&oacute;n donde residas.</p>\r\n<p><strong>REGION METROPOLITANA:</strong>&nbsp;2 a 6 d&iacute;as h&aacute;biles.</p>\r\n<p><strong>REGIONES:</strong>&nbsp;2 a 20 d&iacute;as h&aacute;biles seg&uacute;n regi&oacute;n y comuna . Revisar tabla con el detalle haciendo click aqu&iacute;&nbsp;<a href=\"http://wa2.cl/content/22-costo-y-tiempo-de-entrega\">http://wa2.cl/content/22-costo-y-tiempo-de-entrega</a></p>\r\n<p>Para asegurar que tu producto llegue a destino te recomendamos ingresar una direcci&oacute;n donde t&uacute; o alguien mayor de 18 a&ntilde;os pueda recibir en tu nombre.</p>\r\n<p>No te preocupes, si llegamos a tu casa y no te encuentras dejaremos tu pedido en conserjer&iacute;a. Despacho no incluye llamada telef&oacute;nica previa a la entrega.</p>\r\n<div class=\"preg\">\r\n<p></p>\r\n<p><strong>2.- Retiro en Tienda</strong><br />Despacho&nbsp;<strong>GRATIS</strong>&nbsp;a tu tienda Wados ubicada en&nbsp;<strong>Avenida Espa&ntilde;a 420. Santiago Centro</strong></p>\r\n<p>Este servicio te permite comprar online y retirar tu compra en nuestra tienda Wados ubicada en Avenida Espa&ntilde;a 420. Santiago Centro<br />El tiempo de espera para que tu compra est&eacute; lista para retiro puede variar entre 3 a 6 d&iacute;as h&aacute;biles posteriores a la compra dependiendo si el producto est&aacute; en stock inmediato o deber&aacute; ser enviado desde nuestras bodegas a la tienda seleccionada.</p>\r\n<p><strong>&iquest;Como funciona?</strong></p>\r\n<p>Paso 1: agrega tus productos al carro de compra.<br />Paso 2: selecciona el tipo de despacho \" retiro en tienda\".<br />Paso 3: espera nuestro e-mail o llamado telef&oacute;nico confirmando que tu pedido est&aacute; listo y puedas pasar a retirarlo.</p>\r\n<p><strong>Retiro de la compra</strong></p>\r\n<p>Si eres quien realiz&oacute; la compra o fuiste mencionado como la persona que retira el pedido necesitar&aacute;s:<br />- Cedula de identidad.<br />- Numero de pedido.<br />- Firmar un comprobante de entrega del pedido/recibo conforme.</p>\r\n<br />\r\n<p>Una vez recibido el e-mail o llamado telef&oacute;nico confirmando que tu pedido est&aacute; listo&nbsp;<strong>tienes 3 d&iacute;as h&aacute;biles para pasar a retirarlo a la tienda indicada.</strong></p>\r\n<p>El horario para el retiro es de&nbsp;<strong>Lunes a Jueves de 9.30 a 14.00 hrs y luego de 15.00 a 18.30 hrs;<br />Viernes de 9.30 a 14.00 hrs y luego de 15.00 a 17.30 hrs. Excepto festivos. Tienda cerrada s&aacute;bados y domingos.</strong></p>\r\n<p>Si tienes dudas puedes llamar a nuestro Servicio al Cliente al tel&eacute;fono 02-2-4734923 indicando tu n&uacute;mero de pedido.</p>\r\n<p></p>\r\n<br /><br />\r\n<p><strong>&iquest;Tengo un cup&oacute;n de descuento, como puedo utilizarlo?</strong></p>\r\n<p>El uso del cup&oacute;n de descuento es &uacute;nico para cada usuario, no es acumulativo y su tiempo de vigencia se encuentra debidamente especificado.</p>\r\n<p><strong>PASOS:</strong></p>\r\n<p>1. Una vez que decidiste realizar la compra de tu pedido, ingresa el cup&oacute;n de descuento en la secci&oacute;n CUPONES, en el resumen de tu carrito (antes de pagar) tal como se muestra en la imagen inferior.</p>\r\n<p><img src=\"{{media url=\"wysiwyg/PreguntasFrecuentes/cupon-wados.jpg\"}}\" width=\"600\" height=\"178\" /></p>\r\n<p>2. Una vez ingresado, haz click en el bot&oacute;n OK ubicado a un costado para activarlo</p>\r\n<p>3. Ingresado el cup&oacute;n de descuento, el sistema te indicar&aacute; si se ha aplicado de manera correcta ofreci&eacute;ndote el descuento correspondiente, tal como se muestra en la imagen inferior.</p>\r\n<p><img src=\"http://wa2.cl/img/cms/cupon-wados01.jpg\" alt=\"\" width=\"600\" height=\"185\" /></p>\r\n<p>En caso de no visualizar el descuento, no dudes en contactarte con nosotros al tel&eacute;fono 02-2-4734923 o al mail internet@wados.cl para que podamos ayudarte.</p>\r\n<p><strong>&iquest;C&oacute;mo puedo hacer seguimiento de mi compra?</strong></p>\r\n<p>Para ver el estado de tu pedido debes realizar lo sgte.:<br /> 1. Ingresa a tu sesi&oacute;n en \"Mi cuenta\" y buscar todas tus compras realizadas en \"Historia de Detalles de mis Pedidos\"</p>\r\n<p>2. Luego debes seleccionar el pedido y entrar a &ldquo;Detalles&rdquo;</p>\r\n<p>3. En esa secci&oacute;n encontrar&aacute;s \"Mensajes\", donde te informaremos si el pedido fue enviado, el medio de transporte mediante el cual se realiz&oacute; el env&iacute;o y el N&deg; de OT para que puedas hacer seguimiento.</p>\r\n<p>4. Una vez que tu pedido vaya en camino al domicilio, recibir&aacute;s un mail con el N&deg; de OT para que puedas hacer seguimiento a tu pedido.</p>\r\n<p>Si tienes dudas comun&iacute;cate con nosotros al mail internet@wados.cl o ll&aacute;manos al 02-2-4734923 donde te ayudaremos.</p>\r\n<p><strong>Ha ocurrido una demora en mi entrega, &iquest;donde puedo comunicarme?</strong></p>\r\n<p>Si el tiempo de espera ha excedido los d&iacute;as indicados, por favor env&iacute;anos un mail a Servicio al Cliente internet@wados.cl o ll&aacute;manos al 02-2-4734923 donde nos comunicaremos con la empresa de transportes para consultar el estado del pedido y te informaremos a la brevedad v&iacute;a mail.</p>\r\n<p><strong>Compr&eacute; un producto en wados.cl, pero no me gust&oacute; o la talla no me qued&oacute; bien, &iquest;qu&eacute; puedo hacer?</strong></p>\r\n<p>Podr&aacute;s cambiar f&aacute;cilmente los productos que compres en www.wados.cl</p>\r\n<p>Para ello tienes dos formas:</p>\r\n<p><strong>Opci&oacute;n N&deg; 1:</strong></p>\r\n<p>Directo en una tienda propia Wados habilitada de este link http://wa2.cl/tiendas (revisar el detalle, excepto outlet y franquicias) con la boleta dentro de los 30 d&iacute;as legales.</p>\r\n<p>El cambio est&aacute; sujeto al stock disponible en la tienda donde realices la gesti&oacute;n, por lo tanto si no hay del producto que originalmente adquiriste lo puedes cambiar por otro modelo disponible en la tienda y, en el caso de existir diferencia de valor, puedes pagarlo directo en la caja.</p>\r\n<p>El stock de la tienda online no necesariamente es el mismo de una tienda f&iacute;sica, como tampoco los valores de las prendas. Si deseas asegurar el cambio por el mismo producto adquirido, te recomendamos utilizar la opci&oacute;n N&deg; 2 que se detalla a continuaci&oacute;n.</p>\r\n<p><strong>Opci&oacute;n N&deg; 2:</strong></p>\r\n<p>Enviando los productos a tu costo a nuestras oficinas centrales de Stgo. Centro para realizar el cambio y enviarte lo que necesitas. Si deseas esta opci&oacute;n av&iacute;sanos v&iacute;a mail y te enviaremos una Ficha para Cambio la cual debes llenar y enviar dentro de la encomienda, junto con un r&oacute;tulo para env&iacute;o el cual debes pegar sobre la caja que enviar&aacute;s.</p>\r\n<p>Solo se aceptan cambios con boleta de compra original, la cual debe ir dentro de la caja. El costo de despacho de regreso a tu hogar lo pagamos nosotros.</p>\r\n<p>En ambos casos los productos deben estar sin uso alguno, en &oacute;ptimas condiciones y con sus respectivas etiquetas originales.</p>\r\n<p>En caso de que uses la opci&oacute;n N&deg; 2, los productos al momento de llegar ser&aacute;n revisados por nuestro Depto. de Control de Calidad, para asegurar que los productos sean recibidos en las condiciones anteriormente estipuladas.</p>\r\n<p>En caso que los productos no sean recibidos en &oacute;ptimas condiciones lamentablemente tendremos que rechazar el cambio, devolviendo los productos a tu domicilio.</p>\r\n<p>Solo se aceptar&aacute;n cambios con boleta fiscal original dentro del plazo estipulado en la misma.</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p><strong>Compr&eacute; un producto en wados.cl , pero el producto que me enviaron no corresponde o tiene una falla, &iquest;qu&eacute; puedo hacer?</strong></p>\r\n<p>Nuestros procesos de despacho cuentan con 2 instancias de revisi&oacute;n, donde nos aseguramos que los productos sean enviados en perfecto estado de acuerdo al pedido realizado. Es probable que en alg&uacute;n momento nos equivoquemos, si eso sucede por favor comun&iacute;cate a nuestro Servicio al Cliente <a href=\"mailto:internet@wados.cl\">internet@wados.cl</a>&nbsp;o al 02-2-4734923 donde te ayudaremos.</p>\r\n<p><strong>&iquest;Realizan despachos al extranjero?</strong></p>\r\n<p>Por el momento no, s&oacute;lo dentro del Territorio Chileno.</p>\r\n<p><strong>&iquest;Cu&aacute;les son los medios de pago disponibles?</strong></p>\r\n<p>Puedes pagar a trav&eacute;s de la opci&oacute;n Servipag ( tarjeta de casas comerciales Easy, Cmr, Par&iacute;s, Jumbo, Ripley, Cencosud) o Web Pay (Redcompra , tarjetas de cr&eacute;dito bancarias y de d&eacute;bito)</p>\r\n<p><strong>Me gusta un producto, pero tengo algunas dudas &iquest;d&oacute;nde me puedo comunicar para que me ayuden?</strong></p>\r\n<p>Te puedes comunicar con nosotros a trav&eacute;s del mail internet@wados.cl, al 02-2-4724923 o por WhatsApp al +56978790369, donde te ayudaremos a despejar todas tus dudas, para que compres segura</p>\r\n<p>El horario de atenci&oacute;n online es de Lunes a Viernes de 10.00 a 17.30 hrs.</p>\r\n<p><strong>&iquest;C&oacute;mo me comunico con Servicio al Cliente y cu&aacute;l es el horario de atenci&oacute;n?</strong></p>\r\n<p>Para comunicarte con Servicio al Cliente debes enviar un mail a internet@wados.cl o llamar al al 02-2-4724923 .El horario de atenci&oacute;n online es de Lunes a Viernes de 10.00 a 17.30 hrs.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<br />\r\n<style xml=\"space\"><!--\r\na#abajo { display:none;\r\n\r\n\r\n\r\n\r\n\r\n}\r\n\r\n\r\n\r\n\r\n\r\n.xpectrum{\r\n	\r\n	position: absolute;\r\nwidth: 200px;\r\nheight: 20px;\r\n\r\nright: 0px;\r\nmargin-top: 13px;\r\n	}\r\n	\r\n	\r\n	\r\n	\r\n	\r\n	@media (max-width:480px){\r\n		\r\n		\r\n		a#abajo { background: url(http://www.wados.cl/themes/default-bootstrap/img/ancla.png) no-repeat #A2C1D7 center center;\r\nheight: 50px;\r\nwidth: 50px;\r\ndisplay: block;\r\ncontent: \".\";\r\ntext-indent: -9999px;\r\nmargin-right: 0px;\r\nright: 8px;\r\nposition: fixed;\r\nbottom: 8px;\r\nz-index: 9999999999;\r\nborder: dashed 0px #000000;\r\n-moz-border-radius-topleft: 5px;\r\n-moz-border-radius-topright: 5px;\r\n-moz-border-radius-bottomleft: 5px;\r\n-moz-border-radius-bottomright: 5px;\r\n-webkit-border-top-left-radius: 5px;\r\n-webkit-border-top-right-radius: 5px;\r\n-webkit-border-bottom-left-radius: 5px;\r\n-webkit-border-bottom-right-radius: 5px;\r\nborder-top-left-radius: 5px;\r\nborder-top-right-radius: 5px;\r\nborder-bottom-left-radius: 5px;\r\nborder-bottom-right-radius: 5px; display:block;\r\n\r\n\r\n\r\n\r\n\r\n}\r\n\r\na#abajo:hover{ background: url(http://www.wados.cl/themes/default-bootstrap/img/ancla.png) no-repeat #85bdcd center center;\r\nheight: 50px;\r\nwidth: 50px;\r\ndisplay: block;\r\ncontent: \".\";\r\ntext-indent: -9999px;\r\nmargin-right: 0px;\r\nright: 8px;\r\nposition: fixed;\r\nbottom: 8px;\r\nz-index: 9999999999;\r\nborder: dashed 0px #000000;\r\n-moz-border-radius-topleft: 5px;\r\n-moz-border-radius-topright: 5px;\r\n-moz-border-radius-bottomleft: 5px;\r\n-moz-border-radius-bottomright: 5px;\r\n-webkit-border-top-left-radius: 5px;\r\n-webkit-border-top-right-radius: 5px;\r\n-webkit-border-bottom-left-radius: 5px;\r\n-webkit-border-bottom-right-radius: 5px;\r\nborder-top-left-radius: 5px;\r\nborder-top-right-radius: 5px;\r\nborder-bottom-left-radius: 5px;\r\nborder-bottom-right-radius: 5px; display:block;\r\n\r\n\r\n\r\n\r\n\r\n}\r\na#abajo { background: url(http://www.wados.cl/themes/default-bootstrap/img/ancla.png) no-repeat #A2C1D7 center center;\r\nheight: 45px;\r\nwidth: 45px;\r\ndisplay: block;\r\ncontent: \".\";\r\ntext-indent: -9999px;\r\nmargin-right: 0px;\r\nright: 13px;\r\nposition: fixed;\r\nbottom: 12px;\r\nz-index: 9999999999;\r\nborder: dashed 0px #000000;\r\n-moz-border-radius-topleft: 5px;\r\n-moz-border-radius-topright: 5px;\r\n-moz-border-radius-bottomleft: 5px;\r\n-moz-border-radius-bottomright: 5px;\r\n-webkit-border-top-left-radius: 5px;\r\n-webkit-border-top-right-radius: 5px;\r\n-webkit-border-bottom-left-radius: 5px;\r\n-webkit-border-bottom-right-radius: 5px;\r\nborder-top-left-radius: 5px;\r\nborder-top-right-radius: 5px;\r\nborder-bottom-left-radius: 5px;\r\nborder-bottom-right-radius: 5px; display:block;\r\n\r\n\r\n\r\n\r\n\r\n}\r\n\r\n	\r\n.xpectrum {\r\nposition: absolute;\r\nwidth: 200px;\r\nheight: 20px;\r\nright: 86px !important;\r\nmargin-top: 13px;\r\n}\r\n	}\r\n--></style>\r\n</div>','2016-12-02 19:37:21','2016-12-02 21:31:16',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(34,'Tipos y Tiempos de despacho','1column','','','tipos-y-tiempos-de-despacho','','<div id=\"center_column\" class=\"center_column col-xs-12 col-sm-12\"><div class=\"rte\"><p><br><br><strong style=\"font-size:17px;color:#000;\">Tipos y Tiempos de Despacho</strong></p><div class=\"preg\"><p>Tenemos disponible <strong style=\"font-size:13px;\">2 opciones</strong> de despacho para tus pedidos, los cuales debes elegir al momento de pagar. Cada uno tiene sus tiempos y costos diferentes, dependiendo del tipo de despacho que elijas.</p><p><strong>1. Despacho a Domicilio</strong></p><p>Enviamos tu compra a la dirección que escojas</p><p>Las entregas se realizan sólo en días hábiles (eso significa de lunes a viernes exceptuando feriados) y de 9:00 a 20:00 horas.<br> El costo es fijo de $3.990 para todo Chile, independiente de la cantidad de productos que tengas en el carrito.</p><p>El timing de despacho dependerá de la comuna y región donde residas.<br><strong style=\"font-size:13px;\">REGION METROPOLITANA:</strong> 2 a 6 días hábiles.</p><p><strong style=\"font-size:13px;\">REGIONES:</strong> 2 a 20 días hábiles según región y comuna . Revisar tabla con el detalle haciendo click aquí <a href=\"http://wa2.cl/content/22-costo-y-tiempo-de-entrega\">http://wa2.cl/content/22-costo-y-tiempo-de-entrega</a></p><p>Para asegurar que tu producto llegue a destino te recomendamos ingresar una dirección donde tú o alguien mayor de 18 años pueda recibir en tu nombre.</p><p>No te preocupes, si llegamos a tu casa y no te encuentras dejaremos tu pedido en conserjería. Despacho no incluye llamada telefónica previa a la entrega.</p><p><strong>2.- Retiro en Tienda</strong><br> Despacho <strong style=\"font-size:13px;\">GRATIS</strong> a tu tienda Wados ubicada en <strong style=\"font-size:13px;\">Avenida España 420. Santiago Centro</strong></p><p>Este servicio te permite comprar online y retirar tu compra en nuestra tienda Wados ubicada en Avenida España 420. Santiago Centro<br> El tiempo de espera para que tu compra esté lista para retiro puede variar entre 3 a 6 días hábiles posteriores a la compra dependiendo si el producto está en stock inmediato o deberá ser enviado desde nuestras bodegas a la tienda seleccionada.</p><p><strong>¿Como funciona?</strong></p><p>Paso 1: agrega tus productos al carro de compra.<br> Paso 2: selecciona el tipo de despacho \" retiro en tienda\".<br> Paso 3: espera nuestro e-mail o llamado telefónico confirmando que tu pedido está listo y puedas pasar a retirarlo.</p><p><strong>Retiro de la compra</strong></p><p>Si eres quien realizó la compra o fuiste mencionado como la persona que retira el pedido necesitarás:<br> - Cedula de identidad.<br> - Numero de pedido.<br> - Firmar un comprobante de entrega del pedido/recibo conforme.</p> <br><p>Una vez recibido el e-mail o llamado telefónico confirmando que tu pedido está listo <strong style=\"font-size:13px;\">tienes 3 días hábiles para pasar a retirarlo a la tienda indicada.</strong></p><p>El horario para el retiro es de <strong style=\"font-size:13px;\">Lunes a Jueves de 9.30 a 14.00 hrs y luego de 15.00 a 18.30 hrs;<br> Viernes de 9.30 a 14.00 hrs y luego de 15.00 a 17.30 hrs. Excepto festivos. Tienda cerrada sábados y domingos.</strong></p><p>Si tienes dudas puedes llamar a nuestro Servicio al Cliente al teléfono 02-2-4734923 indicando tu número de pedido.</p><div></div></div></div> <br><style>a#abajo { display:none;\r\n\r\n\r\n\r\n\r\n\r\n}\r\n\r\n\r\n\r\n\r\n\r\n.xpectrum{\r\n	\r\n	position: absolute;\r\nwidth: 200px;\r\nheight: 20px;\r\n\r\nright: 0px;\r\nmargin-top: 13px;\r\n	}\r\n	\r\n	\r\n	\r\n	\r\n	\r\n	@media (max-width:480px){\r\n		\r\n		\r\n		a#abajo { background: url(http://www.wados.cl/themes/default-bootstrap/img/ancla.png) no-repeat #A2C1D7 center center;\r\nheight: 50px;\r\nwidth: 50px;\r\ndisplay: block;\r\ncontent: \".\";\r\ntext-indent: -9999px;\r\nmargin-right: 0px;\r\nright: 8px;\r\nposition: fixed;\r\nbottom: 8px;\r\nz-index: 9999999999;\r\nborder: dashed 0px #000000;\r\n-moz-