INSERT INTO `wa2_demail_template` VALUES (1,'Nuevo Pedido','{{template config_path=\"design/email/header_template\"}}\r\n\r\n<table>\r\n    <tr class=\"email-intro\">\r\n        <td>\r\n            <p class=\"greeting\">{{trans \"%customer_name,\" customer_name=$order.getCustomerName()}}</p>\r\n            <p>\r\n                {{trans \"Gracias por su pedido de %store_name.\" store_name=$store.getFrontendName()}}\r\n                {{trans \"Una vez su paquete sea enviado, le enviaremos un numero de seguimiento.\"}}\r\n                {{trans \'Puede comprobar el estado de su pedido <a href=\"%account_url\">ingrese con su cuenta</a>.\' account_url=$this.getUrl($store,\'customer/account/\',[_nosid:1]) |raw}}\r\n            </p>\r\n            <p>\r\n                {{trans \'Si tiene preguntas sobre su pedido, puede enviarnos un correo electrónico a <a href=\"mailto:%store_email\">%store_email</a>\' store_email=$store_email |raw}}{{depend store_phone}} {{trans \'o llamenos a <a href=\"tel:%store_phone\">%store_phone</a>\' store_phone=$store_phone |raw}}{{/depend}}.\r\n                {{depend store_hours}}\r\n                    {{trans \'Our hours are <span class=\"no-link\">%store_hours</span>.\' store_hours=$store_hours |raw}}\r\n                {{/depend}}\r\n            </p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"email-summary\">\r\n        <td>\r\n            <h1>{{trans \'Su pedido <span class=\"no-link\">#%increment_id</span>\' increment_id=$order.increment_id |raw}}</h1>\r\n            <p>{{trans \'Creado <span class=\"no-link\">%created_at</span>\' created_at=$order.getCreatedAtFormatted(2) |raw}}</p>\r\n        </td>\r\n    </tr>\r\n    <tr class=\"email-information\">\r\n        <td>\r\n            {{depend order.getEmailCustomerNote()}}\r\n            <table class=\"message-info\">\r\n                <tr>\r\n                    <td>\r\n                        {{var order.getEmailCustomerNote()|escape|nl2br}}\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n            {{/depend}}\r\n            <table class=\"order-details\">\r\n                <tr>\r\n                    <td class=\"address-details\">\r\n                        <h3>{{trans \"Información de facturación\"}}</h3>\r\n                        <p>{{var formattedBillingAddress|raw}}</p>\r\n                    </td>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"address-details\">\r\n                        <h3>{{trans \"Datos de envío\"}}</h3>\r\n                        <p>{{var formattedShippingAddress|raw}}</p>\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n                <tr>\r\n                    <td class=\"method-info\">\r\n                        <h3>{{trans \"Metodo de Pago\"}}</h3>\r\n                        {{var payment_html|raw}}\r\n                    </td>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <td class=\"method-info\">\r\n                        <h3>{{trans \"Metodo de Envio\"}}</h3>\r\n                        <p>{{var order.getShippingDescription()}}</p>\r\n                        {{if shipping_msg}}\r\n                        <p>{{var shipping_msg}}</p>\r\n                        {{/if}}\r\n                    </td>\r\n                    {{/depend}}\r\n                </tr>\r\n            </table>\r\n            {{layout handle=\"sales_email_order_items\" order=$order area=\"frontend\"}}\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer_template\"}}\r\n',NULL,2,'Pedido',NULL,NULL,'2016-12-20 16:12:46','2016-12-20 19:10:23',NULL,NULL),(2,'Subscripción Exitosa','{{template config_path=\"design/email/header_template\"}}\r\n\r\n{{trans \"Se ha suscrito correctamente a nuestro boletín.\"}}\r\n\r\n{{template config_path=\"design/email/footer_template\"}}',NULL,2,'Se ha suscrito correctamente',NULL,NULL,'2017-01-17 14:46:20','2017-01-17 14:54:09','newsletter_subscription_success_email_template','{\"template config_path=\\\"design\\/email\\/footer_template\\\"\":\"Email Footer Template\",\"template config_path=\\\"design\\/email\\/header_template\\\"\":\"Email Header Template\"}'),(3,'Cancela subscripcion al boletin','{{template config_path=\"design/email/header_template\"}}\r\n\r\n{{trans \"Se ha cancelado la suscripción al boletín.\"}}\r\n\r\n{{template config_path=\"design/email/footer_template\"}}',NULL,2,'Cancelacion Exitosa',NULL,NULL,'2017-01-17 14:55:53','2017-01-17 14:55:53','newsletter_subscription_un_email_template','{\"template config_path=\\\"design\\/email\\/footer_template\\\"\":\"Email Footer Template\",\"template config_path=\\\"design\\/email\\/header_template\\\"\":\"Email Header Template\"}');
